The 1993–94 Green Bay Phoenix men's basketball team represents the &lt;a href="University%20of%20Wisconsin%E2%80%93Green%20Bay"&gt;University of Wisconsin–Green Bay&lt;/a&gt; in the 1993–94 NCAA Division I men's basketball season. Their head coach was &lt;a href="Dick%20Bennett"&gt;Dick Bennett&lt;/a&gt;. They were the champions of the &lt;a href="1994%20Mid-Continent%20Conference%20Men%27s%20Basketball%20Tournament"&gt;Mid-Continent Basketball Tournament&lt;/a&gt; to earn the conference's automatic bid in the 1994 NCAA Tournament, the school's second ever appearance in the tournament. As a 12 seed, the Phoenix defeated the 5 seed University of California in the first round, 61–57. Green Bay would fall to Syracuse in the second round.
